import './Admin.css';
import HeaderAdmin from './Admin/HeaderAdmin';
import Home from './Home';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
function Admin() {
  return (
    <div className="Admin">

      <BrowserRouter>
      <HeaderComponent />
      <Routes>

         {/* <Route path='/api/v1/' element={<UserComponent />}></Route> */}

          <Route path='/admin/*' element={<HeaderAdmin />}></Route>
      </Routes>
      <Home />
      <FooterComponent />
      </BrowserRouter>
    </div>
  );
}

export default Admin;
